import React, { useState } from 'react';

const ContactMeSection = () => {
    const [name, setName] = useState('');
    const [email, setEmail] = useState('');
    const [enquiry, setEnquiry] = useState('enquiry');
    const [comments, setComments] = useState('');
    function formHander(e){
        e.preventDefault();
        console.log({name, email, enquiry, comments})
    }
    return (
        <div>
            <h1>Contact Me</h1>
            <form onSubmit={formHander}>
                <label htmlFor='name'>Name</label>
                <input type='text' id='name' value={name} onChange={e=>setName(e.target.value)} />
                <label htmlFor='email'>Email Address</label>
                <input type='text' id='email'  value={email} onChange={e=>setEmail(e.target.value)} />
                <select name="cars" id="cars" value={enquiry} onChange={e=>setEnquiry(e.target.value)} >
                    <option value="volvo">Volvo</option>
                    <option value="saab">Saab</option>
                    <option value="mercedes">Mercedes</option>
                    <option value="audi">Audi</option>
                </select>
                <label htmlFor='comments'>Your message</label>
                <textarea id="comments" rows="2"  value={comments} onChange={e=>setComments(e.target.value)} />
                <button type='submit'>Submit</button>
            </form>
        </div>
    );
};

export default ContactMeSection;
